// SPDX-License-Identifier: MIT
pragma solidity >0.8.0;

contract MultiSig {
    address[] public approvers;
    uint public quorum;

    struct Transfers {
        uint id;
        uint amount;
        address payable to;
        uint approvals;
        bool sent;
    }
    /**
     * @dev these mappings aren't public we made it just for test!
     */
    mapping(uint => Transfers) public transfers;
    uint public nextId;
    mapping(address => mapping(uint => bool)) public approvals;

    // @test: approvals[msg.sender][1] = true/false;

    constructor(address[] memory _approvers, uint _quorum) payable {
        approvers = _approvers;
        quorum = _quorum;
    }

    function createTransfer(
        uint _amount,
        address payable _to
    ) external only_Approver {
        transfers[nextId] = Transfers(nextId, _amount, _to, 0, false);
        nextId++;
    }

    function sendTransfer(uint _id) external only_Approver {
        require(transfers[_id].sent == false, "transfer has already taken");

        if (approvals[msg.sender][_id] == false) {
            approvals[msg.sender][_id] = true;
            transfers[_id].approvals++;
        }

        // Check if quorum is reached and execute transfer
        if (transfers[_id].approvals >= quorum) {
            transfers[_id].sent = true;
            address payable to = transfers[_id].to;
            uint amount = transfers[_id].amount;
            to.transfer(amount);
        }
    }

    modifier only_Approver() {
        bool allowed = false;
        for (uint i = 0; i < approvers.length; i++) {
            if (approvers[i] == msg.sender) {
                allowed = true;
            }
        }
        require(allowed == true, "only approver allowed");
        _;
    }
}
